import React, { useEffect, useState } from "react";

const DashBoardStocktaking = ({ stocktake }) => {
  return (
    <div>
      <h6>
        Stocktaking
        {stocktake ? "Stocktake in Progress" : "No Stocktake in Progress"}
      </h6>
    </div>
  );
};

export default DashBoardStocktaking;
